import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";

function createCard(entry) {
  return (
    <Entry
      id={entry.id}
      key={entry.id}
      emoji={entry.emoji}
      name={entry.name}
      meaning={entry.meaning}
    />
  );
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">{emojipedia.map(createCard)}</dl>
    </div>
  );
}

export default App;
